         "description":"Customize your Mini Liquor Bottles! Add custom labels to mini liquor bottles for your next party, wedding, or event! This item can be ordered with the labels only or with the labels and empty bottles. Want this customized for a different occasion or in a different way? Just contact us and we would be happy to create a custom listing for you.\r\n\r\nFeel free to give us a call with any questions (888) 959-2870 M-F 9am - 5pm Central or send us a convo anytime!\r\n\r\nIF YOU CHOOSE THE LABELS ONLY OPTION:\r\nPurchase your favorite brand of mini bottles and apply our custom labels over the existing ones. \r\n\u2013 Custom labels only (Mini bottles not included)\r\n\u2013 Designed to fit 50 mL Jack Daniels, Captain Morgan, Smirnoff, Southern Comfort, and other brands of airplane bottles.\r\n\u2013 The labels are approximately 3\u2033 wide x 1 7\/8\u2033 high.\r\n\u2013 Please compare these dimensions to your liquor bottle labels because bottles and labels may vary.\r\n\u2013 These labels are printed on waterproof vinyl and are cut to fit over the original label.\r\n\u2013 The labels have an adhesive back and apply to the bottle like a sticker.\r\n\r\nIF YOU CHOOSE THE LABELS AND ROUND\/SQUARE BOTTLES OPTION:\r\nPurchase a large bottle of your favorite liquor or mix a cocktail, fill the included bottles, and apply the custom labels. \r\n\u2013 Kit includes: custom labels, empty 50 mL plastic bottles, black bottle caps, and a funnel (Liquor not included)\r\n\u2013 The labels are approximately 3\u2033 wide x 1 7\/8\u2033 high.\r\n\u2013 Fill the empty mini bottles with the funnel, secure tamper-evident caps, and apply the custom labels.\r\n\u2013 The labels have an adhesive back and apply to the bottle like a sticker.\r\n\u2013 The empty 50 mL bottles are available in round or square.\r\n\r\nTO ORDER:\r\nPlease send us the following information:\r\n- Bride and Groom&#39;s First Names\r\n- Future Last Name\r\n- Wedding Date\r\n- Background Color Choice (Black in the photo)\r\n- After checkout, please send a convo to us with the photo you would like to use attached\r\n\r\nThe colors displayed on your monitor may be slightly different from the actual label.\r\n\r\nKEEP SHOPPING:\r\nhttp:\/\/www.etsy.com\/shop\/LiquidCourage\r\nhttp:\/\/liquidcourageflasks.com\r\n\r\nVINETTA MAE:\r\nBe sure to check out our other Etsy shop, Vinetta Mae! It is a monogram boutique with a full lineup of custom phone cases, canvases, prints, signs, and more! \r\nhttp:\/\/www.etsy.com\/shop\/VinettaMae\r\n\r\nThank you for visiting Liquid Courage!\r\nTyler & Amy Fisk",
