         "title":"Engraved Decanter Set  - Monogrammed Bar Set - Decanter Set- Personalized Groomsmen Gift - Father of the Bride - Father of the Groom",
         "description":"Our elegant custom monogrammed executive barware set is personalized with your name and monogram. \n\nOur gorgeous personalized glass decanter is crafted of fine lead-free glass in Italy. Laser engraved with your personalization, it will meet with the expectations of the whiskey connoisseur in your life. \n\nThis wet bar set is a timeless addition to any home bar and\/or man cave as well as a sophisticated gift for the bride and groom, groomsmen, bridesmaids, or parents.  Add a touch  of elegance to your home bar. Custom engraved by SummitEngravingltd.etsy.com \n\nThis heavy-weight glass square design holds 23.25 oz. (700 ml), and is 8.5 inches high. \n\nSet Includes decanter, stopper and four engraved rocks glasses.\n\nIncluded heavy base rocks glasses (set of four) are 8 oz., and are made in the USA.\n\nPersonalization is engraved on all pieces.\n\nThis wet bar set is a timeless addition to any home bar and\/or man cave as well as a sophisticated gift for the bride and groom, groomsmen, bridesmaids, or parents.  Add a touch  of elegance to your home bar. Custom engraved by SummitEngravingltd.etsy.com \n\n**********\n\nPlease enter the personalization information for each item in the notes to seller during checkout. \n\nPlease provide all information as you would like it to appear and add a frame type if desired: Square, rectangle, oval or circle (this frame is engraved around the style you choose--looks best with the classic monograms)\n\nChoose your Monogram Style (see our chart for selections):  Your item will be engraved in the style you choose from the drop down with the information you provide.\n\n\u2022\tTwo Initials   (first initial - last initial)  \n\u2022\tClassic Monogram (first initial -LAST INITIAL - middle initial) \n\u2022\tThree Initials  (first initial - middle initial - last initial)     \n \n\u2022\tFlourish    (with name)  \n\u2022\tCopperplate       (Initial with name)  \n\u2022\tOld English  (Initial with name)       \n\u2022\tEdwardian Script     (Initial with name) \n\u2022\tRibbon     (with name) \n\u2022\tCollegiate  (Initial with name) \n\u2022\tRoman (Initial with name) \n\u2022\tPost Crypt (Initial with name) \n\u2022\tHoney Script (Initial with name) \n\u2022\tCeltic Eels (Initial with name) \n\u2022\tPhenix American (Initial with name) \n\u2022\tViking (Initial with name) \n\u2022\tLavendaria (Initial with name) \n\u2022\tAlgerian (Initial with name) \n\u2022\tOccidental (Initial with name) \n\u2022\tChocolate Box (Initial with name) \n\u2022\tMarketing Script (Initial with name) \n\u2022\tRegal (Initial only -- Not shown on chart -- last image in listing) \n\nThank you for stopping by SummitEngravingLtd.etsy.com",
