            "announcement":"****Current Wait Time for Shipping: 7-10 Business Days****\r\n\r\nThank you for stopping by Magnolia Lane Designs! Here you&#39;ll find all sorts of crafty items that I&#39;ve made. Painted mason jars, mugs, and wreaths are currently my specialty but I will be adding more items every so often. I&#39;ve had several orders for birthdays and weddings and have even been featured in a Justice Clothing Photoshoot! \r\n\r\nPint-sized mason jars too small? Or too big? That&#39;s fine! I can make you a custom listing with larger or smaller sized jars. All you have to do is contact me and we can get started! \r\n\r\nThe mugs would be great for party favors too! Contact me for a special bulk buying rate!\r\n\r\nI look forward to working with you!\r\n\r\nFOLLOW US ON INSTAGRAM FOR THE LATEST NEWS AND PROMOTIONS: \r\nxxMagnoliaLaneDesignsxx\r\n\r\nVisit AzaleaTerraceBoutique.com for the fashionista side of Magnolia Lane Designs!",
            "currency_code":"USD",
