         "description":"Rare Royal Doulton McCallums Scot Whiskey Ash Tray \u2013 1940\u2019s\r\nCheck out this very rare Royal Dalton McCallums Scot Whiskey Ashtray. This piece was made in England by Royal Doulton. I don\u2019t know the year but I would imagine around the 1940\u2019s. As you can see from the photos the Regular Trade Mark logo is printed on both sides of the ashtray. It is ivory ceramic with black graphics that are very, very, good. It measures 5\u201d long x 2\u201d high and 2\u201d deep. It is in remarkable condition considering its age. There are no scratches, chips, staining or fading anywhere on this piece.\r\n\r\nThe Doulton factory was founded in the 1815 to produce drainage and sanitary wares as well as some domestic wares and was producing decorative stonewares by the second half of the 19th century. This is a typical example from the early part of the 20th century.\r\n\r\nWe can combine shipping.  Simply email us the items you\u2019re interested in and zip code and we\u2019ll respond ASAP.  Please email us for Canada, Hawaii, Alaska and international rates.\r\n\r\nThank you for shopping at Blissful Beatrice!",
