            "creation_tsz":1371525759,
            "title":"Custom Liquor Flasks Handmade in the Utah Mountains USA",
            "announcement":"Get Tipsy with our delightfully sassy flasks.\r\nEach flask is made with a special industrial quality polymer wrap, using a permanent dye sublimation method. We are the original creators of polymer wrapped flasks, and we have perfected our process, to give our customers the best quality flasks.  Our flasks are durable, completely waterproof, beautifully made, and have a scratch resistant gloss finish. We do not use vinyl, paper, or messy sealants.  \r\n\r\nThank you so much for visiting our shop, supporting independent designers, and buying handmade items. We hope you enjoy what you see, and come back often. If you do not see what you are looking for, please feel free to convo us, and we can put together a custom order just for you.  \r\n \r\n(All flasks are handmade by myself and my husband Jake, in our smoke free home.) \r\n\r\nCURRENT PRODUCTION TIME 2-5 BUSINESS DAYS\r\n\r\nThanks for stopping by!\r\nKaren :0)",
            "currency_code":"USD",
            "is_vacation":false,
            "vacation_message":"I am currently in the process of re-vamping my shop.  Check back soon for new designs, and new styles of flasks.  If you have any questions, feel free to send me a convo.\r\n\r\nThanks!\r\nKaren \r\nSupa Fly Flasks",
            "sale_message":"Thank you so much for your purchase, I will get started on your order right away, and I will let you know as soon as it ships.  If you have any questions please don&#39;t hesitate to ask. \r\n \r\nHave a spectacular day!\r\nKaren \r\n\r\n---------------------------------------------------------------------------------------\r\nGeneral Shipping Information:\r\nEvery item is made to order, so please allow up to 2-5 business days before your order is shipped. (Though orders will usually ship sooner)\r\n\r\nU.S. Orders will ship USPS first class with tracking. The usual time frame for this is 3-5 business days.\r\n\r\nINTERNATIONAL orders will ship USPS First Class International. Tracking for this service is only available in select countries.  Delivery varies from 10 days to 6 weeks depending on customs and location, so please plan accordingly.\r\n*Please be aware there may be customs fees due when your package is delivered. These fees are the customers responsibility, please know the rules for customs fees in your specific country.*\r\n\r\n**I cannot guarantee that packages will not be damaged, or lost in the mail, but if such a situation should occur, please contact me so we can work to a resolution.**",
            "digital_sale_message":null,
            "last_updated_tsz":1421862024,
            "listing_active_count":197,
            "login_name":"SupaFlyFlasks",
            "accepts_custom_requests":false,
            "policy_welcome":"Thank you for reading my shop policies. I strive to create beautiful quality products at affordable prices.\r\n\r\n-Karen W.",
            "policy_payment":"I currently accept Paypal, and all major credit cards through Paypal, and Etsy Direct Checkout.  Both are very safe and secure ways to make a purchase. Please note that products will be made once payment is received.  Payment is expected at the time of purchase.\r\n",
            "policy_shipping":"Every flask is handmade to order, so please allow up to 2-5 business days before your order is shipped.   \r\n\r\nI add Signature Confirmation on all packages over $250.  Please be aware that if your order exceeds $250 you will need to sign for your package.\r\n\r\nU.S. ORDERS:\r\nwill ship USPS first class with tracking. The usual time frame for this is 3-5 business days.\r\n\r\nINTERNATIONAL ORDERS:\r\nwill ship USPS First Class International. Tracking for this service is only available in select countries. Delivery varies from 10 days to 8 weeks depending on customs and location, so please plan accordingly.\r\n\r\n*Please be aware there may be customs fees due when your package is delivered. These fees are the customers responsibility, please know the rules for customs fees in your specific country.*\r\n\r\nINCORRECT ADDRESSES:\r\nplease make sure to provide the correct address when you are checking out.  If a package is returned due to an incorrect address, the buyer is responsible for postage to re-ship the package.\r\n\r\n**I cannot guarantee that packages will not be damaged or lost in the mail, but if such a situation should occur please contact me so we can work to a resolution.**\r\n \r\nI can only make guarantees on a shipment dates, NOT delivery dates. Unfortunately once a package leaves my hands I do not have control over how fast it moves.",
            "policy_refunds":"If for any reason you are unhappy with your item(s) please contact me BEFORE leaving feedback. \r\n\r\n**REFUND\/RETURN POLICY**\r\n \r\nShipping costs are NOT refundable.  \r\n\r\nCUSTOM ITEMS:\r\nI do not offer refunds or exchanges on custom orders, unless a mistake was made by me. These items can not be re-sold, therefore are not eligible for refunds or exchanges.\r\n\r\nPERSONALIZED ITEMS:\r\nProducts that are personalized (custom names, initials, phrases, etc..) are not eligible for refunds, or exchanges unless a mistake was made by me.  These items can not be re-sold, therefore are not eligible for refunds or exchanges.\r\n\r\nNON PERSONALIZED ITEMS:\r\nIf you would like to return or exchange your non custom item, you must contact me within 5 days of delivery.  After 5 days from delivery, items are not eligible for refunds.  Eligible returned or exchanged items must be postmarked within 3 business days, and must be in original condition with all original packaging.  If you return an item that is not in original condition, a 40% restocking fee will be applied to your refund.  I highly recommend using a shipping service with tracking, because returns or exchanges that are lost in the mail will not be refunded.  ALL shipping costs for returns and exchanges are the BUYERS responsibility. \r\n\r\nIf for any reason you are unhappy with your item(s) please contact me BEFORE leaving a review.  \r\n\r\n \r\nI want you to be happy with your flask, and customer satisfaction is extremely important to me. If you are not satisfied, please contact me right away.",
            "policy_additional":"All our flasks are made with a special high quality polymer wrap using permanent Dye Sublimation. Our wraps are durable, completely waterproof, and have a scratch resistant gloss finish. The design wraps all the way around the flask, slightly overlapping in the back. \r\n\r\nDye Sublimation, is the method of applying an image\/graphic to specially coated ceramics, metals, polyester cloth, and polymers, using specialty sublimation inks, sublimation printers, high heat, and pressure. Sublimation ink is unique because it is converted from a solid to a gas without becoming a liquid. The conversion is initiated by heat and high pressure. The end result is a beautiful and durable work of art that will never fade. \r\n\r\n------------------------------------------------------------------------------------------------------------\r\nCARING FOR YOUR FLASK:\r\n\r\nHand Wash Instructions: \r\nFill your flask with water and swish it around to rinse the inside before and after each use.  If the flask develops an odor, pour a small amount of white vinegar (about three cap fulls), and 1 tbsp. of baking soda into the flask, along with water, then shake the liquid around once the lid is secure. Pour the water out. Do not let the water sit inside the flask for an extended period. If you used vinegar and baking soda, rinse the flask out several times.\r\n\r\n**Allow the flask to air-dry with the lid off.**\r\n\r\nFill the flask with the liquor or beverage of your choice when you are ready to use it. You should not leave liquor in the flask for more than three days at a time.\r\n\r\nRinse out the flask with water after every use and allow it to air-dry.",
