         "description":"This is a neat Mid Century music box decanter that was made to look like Napoleon.  When turned this decanter plays the French National Anthem, La Marseillaise.  This music box decanter is in an overall excellent condition.  There are no chips or cracks in this decanter.  The music plays and the decanter rotates on it&#39;s base.  On two sides of the base of this decanter it reads, &#39;Warming My Belly Button&#39;.  The cork on the stopper of this decanter is complete.  This decanter has not been cleaned and needs a light cleaning.  Please see all of the photos for more information on this music box decanter.\r\n\r\nPlease note that I will combine shipping. If you are interested in more than one item in my shop, please email me, and I will give you a combine shipping cost for all of the items that you wish to purchase.\r\n\r\nIf you have any questions about any of the items listed in my shop, please email me.\r\n\r\nFiling No.: GGG\r\n\r\nI am an established seller on Etsy...\r\n\r\nPlease feel free to visit my other shops to find more vintage items: \r\nwww.etsy.com\/shop\/SnapshotsThroughTime\r\nwww.etsy.com\/shop\/VintageCeramicsGlass\r\nwww.etsy.com\/shop\/VintageBooksPaper",
