            "title":"Eccentric Etched Glass",
            "announcement":"Welcome to Monster Dance Designs!  My functional and fun original designs are individually sandblasted onto dishwasher-safe glassware.\r\n\r\nMix and match discounted multiples in the Build Your Own Set section!\r\n\r\nVisit MonsterDanceDesigns.com to see my ever-growing Design Book and see what I&#39;m working on.  I&#39;m currently working on two new collections for 2015, including more block print designs!\r\n\r\nWholesale orders and consignment orders are also accepted. Please contact me with your ideas, and we can work out the finer points.\r\n\r\nI&#39;m a proud member of Austin Craft Riot!    http:\/\/austincraftriot.com\/\r\n\r\n",
