            "vacation_message":"Wow what a month!  Thank you everyone who stopped by.  My last Christmas orders are shipped, and I need a couple days to catch my breath.  It won&#39;t be long though--I&#39;ll be open again by Christmas Eve!\r\n\r\nWishing you and yours a great Holiday\r\n-Amy",
