            "policy_welcome":"Welcome to Monster Dance Designs!  My functional and fun original designs are individually sandblasted onto dishwasher-safe glassware.  This technique results into a crisp design carved right into the surface of the glass that will never fade or wear off.",
            "policy_payment":"I accept Paypal and credit cards via Direct Checkout.\r\n\r\nYou do not need a PayPal Account to pay for your items through PayPal:\r\nYou can choose the PayPal Option during checkout. After you submit your order click the \u201cPay Now\u201d button. Scroll Down and you will see the option to pay with a Credit or Debit Card WITHOUT having to sign up for a PayPal account.\r\n\r\nItems will not ship until payment has cleared.",
            "policy_shipping":"I ship once or twice a week via USPS, usually on Mondays.  Items in stock ship within 3-5 days. Allow 2-3 weeks for custom items.  If you need it faster, I can try to accommodate for an extra charge.  Please contact me before you buy so we can work it out.  \r\n\r\n I also offer international shipping. International buyers are responsible for all customs fees, duties, and import charges that are levied at the time of delivery.  Be aware that international packages can take up to 6 weeks to arrive in some cases.\r\n\r\nIn cases of different addresses, I will ship to the Etsy address unless told otherwise.",
            "policy_refunds":"Glass is delicate, and I do my best to prepare each piece for it&#39;s journey.  However, sometimes things just happen.  I&#39;ll gladly replace any item that arrives broken.   If you are otherwise unsatisfied, I&#39;ll accept returns repackaged and in the same condition they were sent within 7 days of receipt for exchange or refund. I&#39;m sorry, I cannot accept returns on custom items or refund any shipping costs.",
            "policy_additional":"CUSTOM ORDERS:\r\n\r\nI love doing custom work when my schedule allows. Please budget 2-3 weeks.  Custom pricing is an additional $2-10 to base price of the glass, depending on complexity of the design and revisions.  Every project is a little different, so please contact me for more information and a custom listing.\r\n\r\nWHOLESALE AND CONSIGNMENT\r\n\r\nMy work is available for wholesale and consignment.   For wholesale information, please email me at amy(at)monsterdancedesigns(dot)com for a current linesheet.",
