            "sale_message":"Thank you for your purchase! I am trying my best to get orders out between 24 and 48 hours. Sometimes life gets in the way. If you need a rush order please email me before purchase (if it&#39;s express and more shipment payment is required) or let me know when order is placed if you need it just shipped asap. Thank you!!!",
            "digital_sale_message":null,
            "last_updated_tsz":1421861405,
            "listing_active_count":385,
            "login_name":"Factorygirl82",
            "accepts_custom_requests":false,
            "policy_welcome":"Welcome to Factory Girl Vintage! I am a vintage seller with over ten years of experience working in different vintage stores. In 2006 I opened my vintage store Factory Vintage Clothing in Evanston, Illinois. In 2012 I closed the shop and went to online only. I sell items from the 1900s to the 1990s. \r\n\r\n\r\n\r\n\r\n\r\n",
            "policy_payment":"Payment is due immediately we accept Paypal and Direct Checkout. Orders paid with Paypal get shipped out within 24 hours. Orders paid via direct checkout get sent out within 2 to 4 business days.\r\n\r\nWe do not accept returns or exchanges. All garments are sold as is and we try our absolute best to catch every imperfection. We are humans and sometimes we miss flaws. Garments are vintage most have been worn and typical wear should be expected in garment. That being said if you notice a major flaw we didn&#39;t please contact us and we will work something out. We want our customers to be happy! \r\n\r\nRESERVES\r\n\r\nWe do put items on reserve for 3 days. We appreciate serious shoppers for items on reserve as we have a store front as well and if you decide you&#39;re not interested someone else might be. :-)\r\n\r\nLAYAWAY\r\n\r\nWe are now doing layaway on items over $50. If layaway is requested  a non-refundable deposit of 10% is required. The full balance should be made within 30 days. \r\n\r\nDISCOUNTS\r\n\r\nOur prices are firm and fair. We do not give individual discounts. We do have sales which offer from 10%-25% off. We do promotions for these on our facebook and twitter pages. We do have a frequent buyer discount and we do discounts if you are purchasing more than 3 items all at once. Convo me for those coupons. \r\n",
            "policy_shipping":"We ship packages out generally between 1 to 3 business days\r\n\r\nFor the USA we ship United States Postal Service Priority Mail with a shipping confirmation. If you would like something to be express shipped we are happy to do so just convo me and I will get the quote and adjust the shipping for you. \r\n\r\nFor international shipping we ship usps priority. This is more expensive but it generally takes 6 to 10 business days. It comes with tracking and insurance. We are happy to ship items first class but once it is shipped we can not take responsibility for the item being lost. \r\nThanks!\r\n\r\n",
            "policy_refunds":"We do not accept returns or exchanges. Please read item descriptions carefully before buying, and ask questions. I do not accept returns unless I made a large error in the listing or failed to note a large flaw. If I messed up, we can arrange to have the item returned and a full refund will be issued. Because we are all human, I know it can be easy to misread or misunderstand a listing so I may approve a return in an exceptional case (for example when a child size garment was purchased for an adult). These approved returns are subject to a 15% restocking fee, do not include any postage costs, and are only completed when the item has been returned in original condition. Returns must be received within 7 business days. ",
            "policy_additional":"Find us all over the web! For updates on Inventory, Sales, and Shop Notices. Also check out our blog on vintage clothing, history, fashion, and film.\r\n\r\nFacebook: http:\/\/www.facebook.com\/factoryvintageclothing\r\n\r\nhttp:\/\/www.facebook.com\/caitlin.stephenson\r\n\r\nTwitter: Factorygirl82\r\n\r\n",
            "policy_seller_info":"Factory Girl Vintage",
