         "title":"Doc Fragrance Oil-1 dram\/3.7 ml-mens fragrance-pipe tobacco-bourbon-whiskey-gifts for men",
         "description":"Doc is rich pipe tobacco & good slosh of bourbon whiskey thrown in for good measure.\r\n\r\nThis listing is for one (1) 1-dram amber glass bottle of fragrance oil. This oil has been mixed into a base of pure grapeseed oil....this means you do not have to dilute and it is safe to put it directly on your skin. It is still a very strong oil and a little goes a long way :) \r\n*********************************************************************************************************\r\nThe Outlaw line:\r\n\r\n*Jesse (No. 1) - a rich, leathery fragrance with notes of woods, musk, amber, tobacco plant, hay and aged saddle leather.\r\n\r\n*Dalton (No. 2) - woodsy and creamy. Cedarwood gives it an earthy tone, while the added vanilla bean gives it a hint of sweetness to keep it warm. Dalton has a nice outdoorsy, smokey, campfire feel to it.\r\n\r\n*Ringo (No. 3) - Classically clean, Ringo has a rich base of woods, musk and amber. This oil is infused with natural essential oils of sage, lavandin and orange.\r\nSmells a lot like a clean men&#39;s cologne.\r\n\r\n*Wyatt (No. 4) -the rich scent of pipe tobacco, woods and just a light hint of dark roasted coffee beans. \r\n\r\n*Josey (No 5) -is a cup of black coffee in the morning. You can&#39;t be a cowboy without this decoction :)\r\n\r\n*Doc -(No 6) rich pipe tobacco with a good slosh of bourbon whiskey!\r\n\r\n********************************************************************************************************\r\nHere are just a few ways you can use Outlaw oils!!\r\n\r\n- on your skin as a cologne\r\n- add a few drops to an oil burner (add water)\r\n- put in water for an air freshener spray\r\n- a few drops on your pillow\r\n- a drop on your cold light bulb to scent a room\r\n- keep a cotton ball with fragrance oil under your car seat\r\n- add to plain lotion\r\n- put in oil for massage\r\n- in your wood stove water pan\r\n- on your heat vents\r\n- on a love note\r\n- add to a burning candle\r\n- under the collar of a jacket\r\n- in a gym bag\r\n- in water on stove top",
