            "policy_shipping":"----------------------------------\r\nPRODUCTION TIME\r\n----------------------------------\r\nWe begin production on all items once an order has been placed.  Our current production time is 1 week unless otherwise noted on a specific item&#39;s listing page.\r\n\r\n----------------------------------\r\nSHIPPING ADDRESS\r\n----------------------------------\r\nWe ship to the address provided on your Etsy order at the time of checkout.  Please ensure that this address is correct.  If an incorrect address is supplied, the buyer will be responsible for any fees incurred to re-ship the order to their correct address.\r\n\r\n----------------------------------\r\nSHIPPING A GIFT?\r\n----------------------------------\r\nWe send all orders to the shipping address entered at checkout.  If you need your item shipped directly to a gift recipient please ensure you have entered their address correctly at checkout.  \r\n\r\nGIFT NOTE: When shipping gifts directly, we&#39;re happy to include a short gift note in the package for the recipient.  Just type your note in the &quot;message to seller&quot; box at checkout and be sure to include who it is from! :)\r\n\r\nRECEIPTS: If you would like the receipt left out of your box please make a note at checkout.   Promotional material such as coupons for our shop will still be included with ALL orders.\r\n\r\n----------------------------------\r\nUSA CUSTOMERS\r\n----------------------------------\r\nYour orders will be shipped via Priority or First Class mail, depending on the size.  All US orders come with tracking which will be added to your order details once shipped.\r\n\r\nFor our mutual protection, ALL orders over $200 require a signature for delivery. \r\n\r\nSorry, we do not offer local pickup at this time!\r\n\r\n----------------------------------\r\nINTERNATIONAL  CUSTOMERS\r\n----------------------------------\r\nWe ship via First Class Mail International, which can take about 4-6 weeks in transit.  If you would like to use a faster shipping method, please contact us for prices BEFORE placing your order.\r\n\r\nTracking is included to most international destinations.\r\n\r\nPLEASE NOTE:  We declare the full value on all international customs forms.  Be aware that as the buyer you are responsible for all duties, taxes (VAT, GST, etc.) or customs\/import fees that your package may incur.\r\n\r\n----------------------------------\r\nRUSH ORDERS\r\n----------------------------------\r\nPlease contact us BEFORE purchasing with your Zip Code\/Country and requested deadline if you need your items faster.",
